import React from "react";
import { NavLink } from "react-router-dom";
import Button from "../components/UI/Button";
import NavBar from "../components/UI/Navbar";

const shifts = [
  {
    id: 1,
    shift_date: "2022-05-10 21:00:00",
    shift_dispatcher: "Karamjeet",
  },
  {
    id: 2,
    shift_date: "2022-05-11 05:00:00",
    shift_dispatcher: "Michaël",
  },
];

const ShiftList = () => {
  return (
    <>
      <NavBar></NavBar>
      <div className="flex flex-col py-6">
        <div className="inline-flex justify-center">
          <ul className="gap-4 w-3/4 lg:w-1/2">
            {shifts.map((element, index) => (
              <NavLink to={`shift-detail/${element.id}`}>
                <li
                  key={index}
                  className="bg-white shadow overflow-hidden rounded-md px-6 py-4 my-4 flex flex-row justify-between"
                >
                  <div>
                  <span className="text-base font-semibold">
                      {element.shift_dispatcher}
                    </span>
                  </div>
                  <div>
                    <p className="text-sm font-medium">Tournée du</p>

                  <div className="text-sm">{element.shift_date}</div>
                  </div>
                </li>
              </NavLink>
            ))}
          </ul>
        </div>
        <div className="text-center">
          <NavLink to="create-mission">
            <Button>Créer une tournée</Button>
          </NavLink>
        </div>
      </div>
    </>
  );
};
export default ShiftList;
